import React ,{useState}from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Typography from '@material-ui/core/Typography';
import GroupedSelect from"./select"
import HoverRating from"./rating"
import "./dialog.css"


const styles = (theme) => ({
  root: {
    margin: 0,
    padding: theme.spacing(2),
  },
  closeButton: {
    position: 'absolute',
    right: theme.spacing(1),
    top: theme.spacing(1),
    color: theme.palette.grey[500],
    fontSize:"50px",


  },
});

const DialogTitle = withStyles(styles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogTitle disableTypography className={classes.root} {...other}>
      <Typography variant="h6">{children}</Typography>
      {onClose ? (
        <IconButton aria-label="close" className={classes.closeButton} onClick={onClose}>
          <CloseIcon />
        </IconButton>
      ) : null}
    </MuiDialogTitle>
  );
});

const DialogContent = withStyles((theme) => ({
  root: {
    padding: theme.spacing(5),

  },
}))(MuiDialogContent);

const DialogActions = withStyles((theme) => ({
  root: {
    margin: 0,
    padding: theme.spacing(1),
  },
}))(MuiDialogActions);

export default function CustomizedDialogs() {
  const [open, setOpen] = React.useState(false);
  const [sauna,setSauna]=useState("");
  const [waterBath,setWaterBath]=useState(1);
  const [saunaRoom,setSaunaRoom]=useState(5);
  const [wind,setWind]=useState(1);


  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  function setsauna (name) {
                setSauna(name);
  }

  return (
    <div>
      <Button variant="outlined" color="primary" onClick={handleClickOpen}>
        サウナを追加
      </Button>
      <Dialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open} maxWidth="false">
        <DialogTitle id="customized-dialog-title" onClose={handleClose}>
          サウナログを追加しよう！
        </DialogTitle>
        <DialogContent dividers>
        <Typography gutterBottom>
            どこのサウナ？
            <GroupedSelect setsauna={setsauna}/>
          </Typography>
          <div >
          {sauna}
          </div>
          <div className="rate">
            <div className="eachRate">
          <Typography gutterBottom>
            サ室の評価
            <HoverRating set={setSaunaRoom} value={saunaRoom}/>
          </Typography>
           </div>

           <div className="eachRate">
          <Typography gutterBottom>
            水風呂の評価
            <HoverRating set={setSaunaRoom} value={waterBath}/>
          </Typography>
          </div>

          <div className="eachRate">
          <Typography gutterBottom>
            ととのいスペースの評価
            <HoverRating set={setSaunaRoom} value={wind}/>
          </Typography>
          </div>

          </div>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={handleClose} color="primary">
            Save changes
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
